import React from 'react'

export default function Body () {
  return (
    <div class='ui segment stackable menu'>
      <div class='item'>
        <img src='/images/logo.png' />
      </div>
      <a class='item'>Features</a>
      <a class='item'>Testimonials</a>
      <a class='item'>Sign-in</a>
    </div>
  )
}
